import { Link } from 'react-router-dom';
import css from './HeroHome.module.css';

const HeroHome = () => {
  return (
    <div className={css.heroHome}>
      <div className={css.heroWrap}>
        <h1 className={css.heroTitle}>
          Buy TikTok{' '}
          <span className="pinkText">Likes, Followers, Views & Live Views</span>
        </h1>
        <p className={css.heroText}>
          Don't settle for fake users. StellarLikes delivers followers, likes,
          and views from real users, delivered instantly. At the lowest possible
          prices.
        </p>
        <Link className={css.heroLink} to="/">
          Show me how
        </Link>
      </div>
    </div>
  );
};

export default HeroHome;
